import axios from 'axios';

export const fetchProducerLogs = async () => {
  try {
    const res = await axios.get('http://localhost:8082/logs');
    return res.data;
  } catch (err) {
    console.error("Failed to fetch producer logs", err);
    return [];
  }
};

export const fetchConsumerLogs = async () => {
  try {
    const res = await axios.get('http://localhost:8083/logs');
    return res.data;
  } catch (err) {
    console.error("Failed to fetch consumer logs", err);
    return [];
  }
};
